import React from 'react';
import HeaderProfile from './HeaderProfile.jsx';
import './ProFile.css';
import {Route, Switch} from 'react-router-dom';
import TimeLine from './TimeLine.jsx';
import Gallery from './Gallery.jsx';
import About from './About.jsx';
import Friends from './Friends.jsx';
import ActivityLog from './ActivityLog.jsx';

function MyProfile(props){

  const sendReactionPost = (reaction, postId) => {
    props.sendReactionPost(reaction, postId)
  }

  const onSubmitComment = (value, idPost) => {
    props.onSubmitComment(value, idPost)
  }

  const loadingSendRequestSetting = (type, idPost, idUser) => {
    props.loadingSendRequestSetting(type, idPost, idUser)
  }

  return (
    <>
      <div className="wrapper" >
        <HeaderProfile />
        <div className="profile-content" style={{margin: '10px 0'}}>
          <Switch>
            <Route exact path="/:idProfile"><TimeLine sendReactionPost={sendReactionPost} onSubmitComment={onSubmitComment} loadingSendRequestSetting={loadingSendRequestSetting} loadingSetting={props.loadingSetting}/></Route>
            <Route path="/:idProfile/timeline"><TimeLine sendReactionPost={sendReactionPost} onSubmitComment={onSubmitComment} loadingSendRequestSetting={loadingSendRequestSetting} loadingSetting={props.loadingSetting}/></Route>
            <Route path="/:idProfile/friends" component={Friends}/>
            <Route path="/:idProfile/about" component={About}/>
            <Route path="/:idProfile/gallery" component={Gallery}/>
            <Route path="/:idProfile/activity-log" component={ActivityLog}/>
          </Switch>
        </div>
      </div>
    </>
  )
}

export default MyProfile;
